import React from 'react';
import 'antd/dist/antd.css';

import Algorithms from './components/Algorithms'

function App() {
  state = {
    algorithms: [
      {
        name: 'sar',
        description: 'cos tam1'
      },
      {
        name: 'mm',
        description: 'cos tam2'
      },
      {
        name: 'uknn',
        description: 'cos tam3'
      }
    ]
  }

  return (
    <div className="App">
          <Algorithms algorithms={this.state.algorithms} />
    </div>
  );
}

export default App;
